INSERT INTO ladm_col_211.lc_categoriasuelotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Suburbano',0,'Suburbano','0','Constituyen esta categora las reas ubicadas dentro del suelo rural, en las que se mezclan los usos del suelo y las formas de vida del campo y la ciudad, diferentes a las clasificadas como reas de expansin urbana, que pueden ser objeto de desarrollo con restricciones de uso, de intensidad y de densidad, garantizando el autoabastecimiento en servicios pblicos domiciliarios, de conformidad con lo establecido en la Ley 99 de 1993 y en la Ley 142 de 1994. Podrn formar parte de esta categora los suelos correspondientes a los corredores urbanos interregionales.

Los municipios y distritos debern establecer las regulaciones complementarias tendientes a impedir el desarrollo de actividades y usos urbanos en estas reas, sin que previamente se surta el proceso de incorporacin al suelo urbano, para lo cual debern contar con la infraestructura de espacio pblico, de infraestructura vial y redes de energa, acueducto y alcantarillado requerida para este tipo de suelo. (Artculo 34, Ley 388 de 1997)','Levantamiento_Catastral_V2_11.LC_CategoriaSueloTipo',NULL);
INSERT INTO ladm_col_211.lc_categoriasuelotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Proteccion',1,'Proteccin','0','Constituido por las zonas y reas de terrenos localizados dentro de cualquiera de las anteriores clases, que por sus caractersticas geogrficas, paisajsticas o ambientales, o por formar parte de las zonas de utilidad pblica para la ubicacin de infraestructuras para la provisin de servicios pblicos domiciliarios o de las reas de amenazas y riesgo no mitigable para la localizacin de asentamientos humanos, tiene restringida la posibilidad de urbanizarse. (Articulo 35, Ley 388 de 1997)','Levantamiento_Catastral_V2_11.LC_CategoriaSueloTipo',NULL);
