INSERT INTO ladm_col_211.av_tipificacionconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial_1_Bajo_Bajo',0,'Residencial 1  (Bajo-Bajo)','0','Las viviendas que pertenecen a este grupo estn construidas sin planeacin alguna y generalmente con materiales de desecho tanto en las paredes como en los techos, construido o acondicionado para alojamiento, aunque no rena las condiciones sanitarias indispensables. Generalmente carecen de algn servicio pblico bsico y/o estn ubicadas en zonas marginales no urbanizadas ni urbanizables, siendo de invasin y con escasez de vas de comunicacin y transporte urbano.','Avaluos_V2_11.AV_TipificacionConstruccionTipo',NULL);
INSERT INTO ladm_col_211.av_tipificacionconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial_2_Bajo',1,'Residencial 2  (Bajo)','0','Las viviendas que pertenecen a este grupo estn construidas con o sin planeacin y generalmente con materiales como madera, prefabricado, ladrillo o bloque, cubiertas en zinc o teja de barro y con acabados sencillos, pueden disponer de algunos servicios pblicos bsicos, estn situados por lo general en la periferia y disponen de algunas vas pblicas sin pavimentar y escasos medios de transporte.','Avaluos_V2_11.AV_TipificacionConstruccionTipo',NULL);
INSERT INTO ladm_col_211.av_tipificacionconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial_3_Medio_Bajo',2,'Residencial 3  (Medio-Bajo)','0','Las viviendas que pertenecen a este grupo generalmente estn constituidas por edificaciones tcnicamente planeadas, con fachadas calificadas como regular, con muros de ladrillo o bloque, cubiertas de placa de concreto o teja en asbesto cemento. Generalmente cuentan con servicios pblicos bsicos, poseen vas de comunicacin pavimentadas y medio de transporte urbano.','Avaluos_V2_11.AV_TipificacionConstruccionTipo',NULL);
INSERT INTO ladm_col_211.av_tipificacionconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial_4_Medio',3,'Residencial 4  (Medio)','0','Las viviendas que pertenecen a este grupo generalmente estn constituidas por edificaciones tcnicamente planeadas con fachada calificada de regular a buena, estructura en concreto, muros de ladrillo o bloque revocados, estucados y pintados, cubiertas de placa de concreto o teja en asbesto cemento; baos y cocinas calificados como medianos enchapados.','Avaluos_V2_11.AV_TipificacionConstruccionTipo',NULL);
INSERT INTO ladm_col_211.av_tipificacionconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial_5_Medio_Alto',4,'Residencial 5  (Medio-Alto)','0','Las viviendas que pertenecen a este grupo generalmente estn constituidas por edificaciones totalmente terminadas y tcnicamente planeadas con fachada calificada como buena as como sus acabados, estructura en concreto. Generalmente cuentan con muros de ladrillo o bloque, cubiertas de placa de concreto o con materiales de buena calidad; baos y cocinas calificados como buenos y tamao entre mediano y grande.
Cuentan con todos los servicios pblicos bsicos y complementarios, con grandes zonas verdes, sociales y de recreacin, parqueaderos y buenas vas de acceso.','Avaluos_V2_11.AV_TipificacionConstruccionTipo',NULL);
INSERT INTO ladm_col_211.av_tipificacionconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Residencial_6_Alto',5,'Residencial 6  (Alto)','0','Las viviendas que pertenecen a este grupo generalmente estn constituidas por edificaciones con grandes reas, amplios jardines o apartamentos lujosos, paredes de bloque o ladrillo, cubiertas de placa de concreto o con materiales de excelente calidad y cuentan con los servicios pblicos bsicos y complementarios.
Estas viviendas estn ubicadas en sectores exclusivos y disfrutan de amplias zonas verdes, sociales y de recreacin, parqueaderos y excelentes vas de acceso.','Avaluos_V2_11.AV_TipificacionConstruccionTipo',NULL);
INSERT INTO ladm_col_211.av_tipificacionconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Comercial_Barrial',6,'Comercial barrial','0','Corresponde a la venta de bienes y servicios de consumo domstico requeridos por la comunidad de residentes en barrios. Presenta dos modalidades principales de desarrollo: en reas o espacios de edificaciones residenciales que fueron destinadas al uso comercial sin adecuaciones fsicas importantes, ni del espacio mismo, ni del resto de la vivienda que se mantiene como tal; en establecimientos situados en edificaciones multifamiliares, en manzanas o en locales comerciales de las urbanizaciones.','Avaluos_V2_11.AV_TipificacionConstruccionTipo',NULL);
INSERT INTO ladm_col_211.av_tipificacionconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Comercial_Sectorial',7,'Comercial sectorial','0','Corresponde al destinado a la venta de productos y/o servicios ubicados en un sector consolidado o en proceso de consolidacin.','Avaluos_V2_11.AV_TipificacionConstruccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Transito',0,'(Servidumbre) Trnsito','0','Se trata de predio sirviente que sufre el gravamen para permitir la comunicacin uso y bienestar de otro predio. (Artculo 905 del C.C.)','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Aguas_Negras',1,'(Servidumbre) Aguas negras','0','Es el gravamen impuesto sobre un predio para permitir la salida de las aguas sobrantes de otro predio. (Art. 928 del C.C.).','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Aire',2,'(Servidumbre) Aire','0','Permite realizar y mantener las obras necesarias para la eficiencia y segura ventilacin. Las empresas de servicios pblicos podrn pasar por predios ajenos por va area y realizar en ellos las actividades necesarias para prestar el servicio. (Artculo 215 del Decreto 1275 de 1970, artculo 57 de la Ley 142 de 1994).','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Energia_Electrica',3,'(Servidumbre) Energa elctrica','0','Supone para las entidades pblicas que tienen a su cargo la construccin de centrales generadoras, lneas de interconexin, transmisin y prestacin del servicio pblico de distribucin de energa elctrica, la facultad de pasar por los predios afectados, por va area, subterrnea o superficial, las lneas de transmisin y distribucin del fluido elctrico, ocupar las zonas objeto de servidumbre, transitar por los mismos, adelantar las obras, ejercer la vigilancia, conservacin y mantenimiento y emplear los dems medios necesarios para su ejercicio. (Artculo 18 de la Ley 126 de 1938 y Artculo 25 de la Ley 56 de 1981). (Artculo 57 de la Ley 142 de 1994).','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Gasoducto',4,'(Servidumbre) Gasoducto','0','Es el conjunto de actividades ordenadas a la distribucin de gas combustible, por tubera u otro medio, desde un sitio de acopio de grandes volmenes o desde un gasoducto central hasta la instalacin de un consumidor final, incluyendo su conexin y medicin.
Se constituye la servidumbre a favor de la explotacin de los gases derivados del petrleo.
Cuando sea necesario las empresas que prestan el servicio podrn pasar por predios ajenos por va subterrnea o superficial los cables o tuberas, ocupar temporalmente las zonas que requieren esos predios, remover los cultivos y obstculos de toda clase que se encuentren en ellos, transitar, adelantar las obras y ejercer vigilancia en ellos y en general realizar todas las actividades necesarias para prestar el servicio.
Las lneas de distribucin de gas combustible, podrn atravesar los ros, caudales, lneas frreas, puentes, calles, caminos, y cruzar acueductos, oleoductos, y otras lneas o conducciones. (Art. 14 nmeral 28, y artculo 57 de la Ley 142 de 1994).','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Luz',5,'(Servidumbre) Luz','0','Tiene por objeto dar luz a un espacio cualquiera, cerrado y techado.
Se llama predio sirviente el que debe permitir el paso de la luz y predio dominante el que tiene derecho a ella. (Artculos 931 al 935 del Cdigo Civil).','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Oleoducto',6,'(Servidumbre) Oleoducto','0','Se constituye a favor de la explotacin de petrleo, comprendiendo el terreno suficiente para las estaciones de bombeo y dems dependencias necesarias para el funcionamiento de los oleoductos y el de establecer muelles, cargaderos y tuberas submarinas y fluviales. (Artculo 9 Decreto 1056 de 1954).','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Agua',7,'(Servidumbre) Agua','0','El predio inferior est sujeto a recibir las aguas que descienden del predio superior naturalmente, es decir, sin que la mano del hombre contribuya a ello. No se puede, por consiguiente, dirigir un albaal o acequia sobre el predio vecino, si no se ha constituido esta servidumbre especial. En el predio servil no se puede hacer cosa alguna que estorbe la servidumbre natural, ni el predio dominante, que la grave.','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Minera',8,'(Servidumbre) Minera','0','Para el ejercicio eficiente de la industria minera en todas sus fases y etapas, podrn establecerse las servidumbres que sean necesarias sobre los predios ubicados dentro o fuera del rea objeto del ttulo minero. Cuando, para la construccin, el montaje, la explotacin, el acopio y el beneficio, en ejercicio de las servidumbres se requiera usar recursos naturales renovables, ser indispensable que dicho uso est autorizado por la autoridad ambiental, cuando la ley as lo exija. Tambin procede el establecimiento de servidumbre sobre zonas, objeto de otros ttulos mineros. Tales gravmenes no podrn impedir o dificultar la exploracin o la explotacin de la concesin que los soporte. (Art 166 Ley 685 de 2001)','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Legal_Hidrocarburos',9,'(Servidumbre) Legal de hidrocarburos','0','La industria de los hidrocarburos est declarada de utilidad pblica en sus ramos de exploracin, produccin, transporte, refinacin y distribucin. Los predios debern soportar todas las servidumbres legales que sean necesarias para realizar las actividades de exploracin, produccin y transporte de los hidrocarburos, salvo las excepciones establecidas por la ley. Se entender que la servidumbre de ocupacin de terrenos comprender el derecho a construir la infraestructura necesaria en campo e instalar todas las obras y servicios propios para beneficio del recurso de los hidrocarburos y del ejercicio de las dems servidumbres que se requieran. (Art. 1 Ley 1274 de 2009)','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Medianeria',10,'(Servidumbre) Medianeria','0','Es el conjunto de derechos y obligaciones que dimanan de la existencia y disfrute en comn de una pared, cerca, vallado, etc.
En todos los casos, y aun cuando conste que una cerca o pared divisoria pertenece exclusivamente a uno de los predios contiguos, el dueo del otro predio tendr el derecho de hacer la medianera en todo o en parte, aun sin el consentimiento de su vecino, pagndole la mitad del valor del terreno en que est hecho el cerramiento, y la mitad del valor actual de la porcin del cerramiento cuya medianera pretende. (Artculo 912 del C.C.).','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Alcantarillado',11,'(Servidumbre) Alcantarillado','0','Gravamen que afecta un predio, permitiendo que sobre el se conduzcan el alcantarillado que benefician a otro predio de diferente propietario.','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.lc_restricciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Servidumbre.Acueducto',12,'(Servidumbre) Acueducto','0','Gravamen que afecta un predio, permitiendo que sobre el se conduzcan las aguas que benefician a otro predio de diferente propietario. (Artculos 919 a 930 del Cdigo Civil; Artculo 214 del Decreto 1275 de 1970. Artculo 57 de la Ley 142 de 1998).','Levantamiento_Catastral_V2_11.LC_RestriccionTipo',NULL);
INSERT INTO ladm_col_211.snr_fuentetipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Acto_Administrativo',0,'Acto administrativo','0','Un acto administrativo es toda manifestacin o declaracin emanada de la administracin pblica en el ejercicio de potestades administrativas, mediante el que impone su voluntad sobre los derechos, libertades o intereses de otros sujetos pblicos o privados y que queda bajo el del comienzo.','Datos_SNR_V2_11.SNR_FuenteTipo',NULL);
INSERT INTO ladm_col_211.snr_fuentetipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Escritura_Publica',1,'Escritura pblica','0','Una escritura pblica es un documento pblico en el que se realiza ante un notario pblico un determinado hecho o un derecho autorizado por dicho fedatario pblico, que firma con el otorgante u otorgantes,mostrando sobre la capacidad jurdica del contenido y de la fecha en que se realiz','Datos_SNR_V2_11.SNR_FuenteTipo',NULL);
INSERT INTO ladm_col_211.snr_fuentetipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Sentencia_Judicial',2,'Sentencia judicial','0','La sentencia es la resolucin judicial definitiva dictada por un juez o tribunal que pone fin a la litis o caso sometido a su conocimiento y cierra definitivamente su actuacin en el mismo','Datos_SNR_V2_11.SNR_FuenteTipo',NULL);
INSERT INTO ladm_col_211.snr_fuentetipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Documento_Privado',3,'Documento privado','0','Documento que contiene un compromiso entre dos o ms personas que lo firman.','Datos_SNR_V2_11.SNR_FuenteTipo',NULL);
