INSERT INTO ladm_col_211.lc_objetoconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Cubierta.Azotea_Aluminio_Placa_Sencilla_Con_Eternit',14,'(Cubierta) Azotea, aluminio, placa sencilla con eternit o teja de barro','0',NULL,'Levantamiento_Catastral_V2_11.LC_ObjetoConstruccionTipo',NULL);
INSERT INTO ladm_col_211.lc_objetoconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Cubierta.Placa_Impermeabilizada_Cubierta_Lujosa_U_Ornamental',15,'(Cubierta) Placa imperbeabilizada cubierta lujosa u ornamental','0',NULL,'Levantamiento_Catastral_V2_11.LC_ObjetoConstruccionTipo',NULL);
INSERT INTO ladm_col_211.lc_objetoconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Fachada.Pobre',16,'(Fachada) Pobre','0','-Puerta:  Fabricada con materiales como: Maderas burdas, lmina de zinc, lata o latones carecen por completo de lujos.

-Ventanas:  En la gran mayora de casos son pequeas, en madera burda o ngulo de hierro sencillo.

-Cubrimiento del muro:  Generalmente los muros no tienen cubrimiento, se presentan con ladrillo corrientes o bloque a la vista y en algunos casos pintura de cal o carburo directamente sobre el ladrillo, y en ocasiones paete sin pintar o con pinturas muy econmicas.','Levantamiento_Catastral_V2_11.LC_ObjetoConstruccionTipo',NULL);
INSERT INTO ladm_col_211.lc_objetoconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Fachada.Sencilla',17,'(Fachada) Sencilla','0','-Puerta:  En maderas sin trabajar o lminas metlicas sin ornamentacin

-Ventanas:  Pequeas o de regular tamao, en madera sin trabajo ornamental o metal con pintura de aceite.

-Cubrimiento de muros:  En la mayora de los casos se encuentran paetes con pinturas econmicas, o ladrillo prensado a la vista, generalmente un solo plano en el frente.','Levantamiento_Catastral_V2_11.LC_ObjetoConstruccionTipo',NULL);
INSERT INTO ladm_col_211.lc_objetoconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Fachada.Regular',18,'(Fachada) Regular','0','-Puerta de distintos tamaos, construidas en madera elaborada, o metal en lmina doblada, con rejas en ornamentacin metlica en la mayora de los casos.

-Cubrimiento:  Se encuentran frecuentemente paetados y enlucidos con pintura de regular calidad; en urbanizaciones se utiliza bastante el paete rstico pintado con cal o carburo.  Otras opciones son: En ladrillo prensado a la vista, el granito y la chapa de piedra de presentacin sencilla.  Hasta dos planos enfrente y con una longitud entre 7 y 8 mts, con antejardn, donde la puerta de garaje forma parte integral de esta fachada.','Levantamiento_Catastral_V2_11.LC_ObjetoConstruccionTipo',NULL);
INSERT INTO ladm_col_211.lc_objetoconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Fachada.Buena',19,'(Fachada) Buena','0','-Puertas en maderas con cierto trabajo manual; en algunos casos en lmina prensada (pintada en aceite o en muy pocos casos al duco) con metal ornamentado y vidrio martillado.

-Ventanas:  Amplias, en lmina prensada o madera trabajada, pintura de aceite.  Las ventanas ocupan buena parte del frente y la fachada.

-Cubrimiento:  Paete en cemento, pintura en vinilo, ladrillo prensado a la vista pintado en aceite, granito rstico fino pintado en vinilo, piedra pulida.

-La fachada presenta varios planos y tiene una longitud entre 10 y 14 mts, en el cual la puerta del garaje, en ocasiones doble, participa en forma importante.','Levantamiento_Catastral_V2_11.LC_ObjetoConstruccionTipo',NULL);
INSERT INTO ladm_col_211.lc_objetoconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Fachada.Lujosa',20,'(Fachada) Lujosa','0','-Puertas en maderas con cierto trabajo manual; en algunos casos en lmina prensada (pintada en aceite o en muy pocos casos al duco) con metal ornamentado y vidrio martillado.

-Ventanas:  Amplias, en lmina prensada o madera trabajada, pintura de aceite.  Las ventanas ocupan buena parte del frente y la fachada.

-Cubrimiento:  Paete en cemento, pintura en vinilo, ladrillo prensado a la vista pintado en aceite, granito rstico fino pintado en vinilo, piedra pulida.

-La fachada presenta varios planos y tiene una longitud entre 10 y 14 mts, en el cual la puerta del garaje, en ocasiones doble, participa en forma importante.','Levantamiento_Catastral_V2_11.LC_ObjetoConstruccionTipo',NULL);
