INSERT INTO ladm_col_211.lc_objetoconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Mobiliario_Banio.Pobre',43,'(Mobiliario de bao) Pobre','0','Cuenta con uno o mximo dos servicios entre lavamanos retrete y ducha; los porcelanizados, en caso de tenerlos, son muy econmicos; exceptuando los gabinetes pequeos de latn, no tiene ningn otro mobiliario ni divisiones.','Levantamiento_Catastral_V2_11.LC_ObjetoConstruccionTipo',NULL);
INSERT INTO ladm_col_211.lc_objetoconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Mobiliario_Banio.Sencillo',44,'(Mobiliario de bao) Sencillo','0','Esta categora de baos cuenta con tres servicios.  Los porcenalizados de esta categora son del tipo standard, se encuentran gabinetes muy sencillos y en latn y ocasionalmente pequeos armarios en madera burda o metal.','Levantamiento_Catastral_V2_11.LC_ObjetoConstruccionTipo',NULL);
INSERT INTO ladm_col_211.lc_objetoconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Mobiliario_Banio.Regular',45,'(Mobiliario de bao) Regular','0','Tiene mnimo tres servicios pero de tipo econmico.  Tienen gabinetes de regular tamao, algunas veces empotrados, lavamanos con mueble o pedestal y divisin de la ducha.','Levantamiento_Catastral_V2_11.LC_ObjetoConstruccionTipo',NULL);
INSERT INTO ladm_col_211.lc_objetoconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Mobiliario_Banio.Bueno',46,'(Mobiliario de bao) Bueno','0','Cuenta como mnimo con cuatro servicios, los porcenalizados son finos, en colores, con pedestales, adornos y grifera fina, tina, planchas de lavamanos generalmente en mrmol con muebles en madera trabajada de tamaos regulares a grandes, con espejos ms o menos grandes con luz integrada, la tina forma parte de la ducha, en el mismo espacio.

Tambin se encuentran pequeos armarios y gabinetes auxiliares en madera o acrlico, empotrados o sobrepuestos.  Normalmente presentan divisin de la ducha, construida en aluminio y cristalita.','Levantamiento_Catastral_V2_11.LC_ObjetoConstruccionTipo',NULL);
INSERT INTO ladm_col_211.lc_objetoconstrucciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Mobiliario_Banio.Lujoso',47,'(Mobiliario de bao) Lujoso','0',NULL,'Levantamiento_Catastral_V2_11.LC_ObjetoConstruccionTipo',NULL);
