INSERT INTO ladm_col_211.lc_prediotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Publico.Baldio',0,'(Pblico) Baldo','0','Es un bien inmueble de propiedad de la Nacin y ubicado en zonas rurales','Levantamiento_Catastral_V2_11.LC_PredioTipo',NULL);
INSERT INTO ladm_col_211.lc_prediotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Publico.Fiscal',1,'(Pblico) Fiscal','0','Los bienes de la Unin cuyo uso no pertenece generalmente a los habitantes, se llaman bienes de la Unin o bienes fiscales','Levantamiento_Catastral_V2_11.LC_PredioTipo',NULL);
INSERT INTO ladm_col_211.lc_prediotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Publico.Patrimonial',2,'(Pblico) Patrimonial','0','Son bienes patrimoniales los de titularidad de las administraciones pblicas que no tengan el carcter de bienes de dominio pblico, es decir, que no estn destinados directamente al uso pblico o afectados a un servicio pblico. Si no consta la afectacin de un bien se presume su carcter patrimonial.','Levantamiento_Catastral_V2_11.LC_PredioTipo',NULL);
INSERT INTO ladm_col_211.lc_prediotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Publico.Uso_Publico',3,'(Pblico) Uso pblico','0','Son aquellos inmuebles de dominio pblico cuyo uso pertenece a todos los habitantes del territorio nacional, destinados al uso o disfrute colectivo.','Levantamiento_Catastral_V2_11.LC_PredioTipo',NULL);
INSERT INTO ladm_col_211.lc_prediotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Privado',4,'(Privado)','0','Es aquel que ha salido del patrimonio del estado, cuenta con un propietario inscrito en el folio de matrcula y se considera propiedad privada en los trminos del artculo 48 de la Ley 160 de 1993.','Levantamiento_Catastral_V2_11.LC_PredioTipo',NULL);
INSERT INTO ladm_col_211.lc_prediotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Territorio_Colectivo',5,'(Territorio colectivo)','0','es el predio que pertenece al estado y/o cuyo propietario es una entidad de derecho pblico','Levantamiento_Catastral_V2_11.LC_PredioTipo',NULL);
INSERT INTO ladm_col_211.lc_prediotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Vacante',6,'Vacante','0','Son bienes inmuebles que se encuentran dentro de territorio respectivo a cargo de la Nacin, sin dueo aparente o conocido','Levantamiento_Catastral_V2_11.LC_PredioTipo',NULL);
INSERT INTO ladm_col_211.lc_estadoconservaciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Malo',0,'Malo','0','Se agrupan en este concepto, aquellas estructuras con el mayor grado de deterioro que se puedan encontrar, en condiciones precarias lo cual las hace prcticamente inhabitables.  Generalmente se presenta en construcciones antiguas o con material de muy mala calidad.','Levantamiento_Catastral_V2_11.LC_EstadoConservacionTipo',NULL);
INSERT INTO ladm_col_211.lc_estadoconservaciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Regular',1,'Regular','0','En esta categora, se clasifican aquellas estructuras que tienen algunos daos menores, (agrietamiento de paredes, hundimiento de pisos, etc.) pero que todava se encuentran en condiciones aceptables, sin peligros eminentes o exigencias imperativa de reparaciones inmediatas.  Se presenta con frecuencia en construcciones ms o menos antiguas o materiales de regular calidad.','Levantamiento_Catastral_V2_11.LC_EstadoConservacionTipo',NULL);
INSERT INTO ladm_col_211.lc_estadoconservaciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Bueno',2,'Bueno','0','Se calificarn como tales, aquellas estructuras, no necesariamente nuevas, que se hallan cumpliendo a cabalidad con la funcin para las que fueron construidas, no demuestran deterioro, al menos visibles, y por efectos de uso se encuentran solamente un tanto deslucidas y sus materiales son de buena calidad.','Levantamiento_Catastral_V2_11.LC_EstadoConservacionTipo',NULL);
INSERT INTO ladm_col_211.lc_estadoconservaciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Excelente',3,'Excelente','0','Se define en este grado, el estado de conservacin de una estructura nueva en la que no se vislumbra deterioro, no se observa dao y en la cual los materiales y los acabados son de ptima calidad.','Levantamiento_Catastral_V2_11.LC_EstadoConservacionTipo',NULL);
INSERT INTO ladm_col_211.col_metodoproducciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Metodo_Directo',0,'Mtodo directo','0','Aquellos que requieren una visita campo con el fin de
recolectar la realidad de los bienes inmuebles.','LADM_COL_V1_7.LADM_Nucleo.COL_MetodoProduccionTipo',NULL);
INSERT INTO ladm_col_211.col_metodoproducciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Metodo_Indirecto',1,'Mtodo indirecto','0','aquellos mtodos identificacin fsica, jurdica y
econmica de los inmuebles a travs del uso de de sensores
remotos, integracin registros administrativos, modelos sticos y
economtricos, anlisis de Big Data y fuentes secundarias como
