INSERT INTO ladm_col_211.col_metodoproducciontipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Medoto_Declarativo_y_Colaborativo',2,'Metodo declarativo y colaborativo','0','Son los derivados participacin de la comunidad en el suministro de informacin que sirva como insumo para el desarrollo de los procesos catastrales. Los gestores catastrales propendern por la adopcin nuevas tecnologas y procesos comunitarios que faciliten la participacin los ciudadanos.','LADM_COL_V1_7.LADM_Nucleo.COL_MetodoProduccionTipo',NULL);
