INSERT INTO ladm_col_211.av_usosuelourbanotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Comercial',1,'Comercial','0','Es aquel espacio geogrfico dedicado a la venta de mercancas (almacenes, centros comerciales, aeropuerto, etc.) y de servicios (oficinas, hoteles, restaurantes, bancos, consultorios, etc.). Se incluyen corredores comerciales en barrios residenciales.','Avaluos_V2_11.AV_UsoSueloUrbanoTipo',NULL);
