INSERT INTO ladm_col_211.av_usosuelourbanotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Institucional',3,'Institucional','0','Es aquel espacio geogrfico dedicado a la administracin y prestacin de servicios del estado (hospitales, colegios, alcalda, canchas deportivas, etc.) y que no se encuentra clasificado en otros usos.','Avaluos_V2_11.AV_UsoSueloUrbanoTipo',NULL);
