INSERT INTO ladm_col_211.col_fuenteespacialtipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Ortofoto',2,'Ortofoto','0','Imagen producto de la toma de fotografas areas o satlites, en la cual han sido corregidos los desplazamientos causados por la inclinacin de la cmara o sensor y la curvatura de la superficie del terreno. Est referida a un sistema de proyeccin cartogrfica, por lo que posee las caractersticas geomtricas de un mapa con el factor adicional de que los objetos se encuentran representados de forma real en la imagen de la fotogrfica.','LADM_COL_V1_7.LADM_Nucleo.COL_FuenteEspacialTipo',NULL);
