INSERT INTO ladm_col_211.lc_clasesuelotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Urbano',0,'Urbano','0','Constituyen el suelo urbano, las reas del territorio distrital o municipal destinadas a usos urbanos por el plan de ordenamiento, que cuenten con infraestructura vial y redes primarias de energa, acueducto y alcantarillado, posibilitndose su urbanizacin y edificacin, segn sea el caso. Podrn pertenecer a esta categora aquellas zonas con procesos de urbanizacin incompletos, comprendidos en reas consolidadas con edificacin, que se definan como reas de mejoramiento integral en los planes de ordenamiento territorial.

Las reas que conforman el suelo urbano sern delimitadas por permetros y podrn incluir los centros poblados de los corregimientos. En ningn caso el permetro urbano podr ser mayor que el denominado permetro de servicios pblicos o sanitario. (Artculo 31, Ley 388 de 1997)','Levantamiento_Catastral_V2_11.LC_ClaseSueloTipo',NULL);
INSERT INTO ladm_col_211.lc_clasesuelotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Rural',1,'Rural','0','Constituyen esta categora los terrenos no aptos para el uso urbano, por razones de oportunidad, o por su destinacin a usos agrcolas, ganaderos, forestales, de explotacin de recursos naturales y actividades anlogas. (Artculo 33, Ley 388 de 1997)','Levantamiento_Catastral_V2_11.LC_ClaseSueloTipo',NULL);
INSERT INTO ladm_col_211.lc_clasesuelotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Expansion_Urbana',2,'Expansin urbana','0','Constituido por la porcin del territorio municipal destinada a la expansin urbana, que se habilitar para el uso urbano durante la vigencia del plan de ordenamiento, segn lo determinen los Programas de Ejecucin.

La determinacin de este suelo se ajustar a las previsiones de crecimiento de la ciudad y a la posibilidad de dotacin con infraestructura para el sistema vial, de transporte, de servicios pblicos domiciliarios, reas libres, y parques y equipamiento colectivo de inters pblico o social.

Dentro de la categora de suelo de expansin podrn incluirse reas de desarrollo concertado, a travs de procesos que definan la conveniencia y las condiciones para su desarrollo mediante su adecuacin y habilitacin urbanstica a cargo de sus propietarios, pero cuyo desarrollo estar condicionado a la adecuacin previa de las reas programadas. (Artculo 32, Ley 388 de 1997)','Levantamiento_Catastral_V2_11.LC_ClaseSueloTipo',NULL);
