INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Acuicola',0,'Acuicola','0','Se califica con destino acucola, aquellos predios donde se realizan cultivos de organismos acuticos, en ambientes naturales o artificiales.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Agricola',1,'Agrcola','0','Se califica con destino agrcola, aquellos predios con funcionalidad de laboreo agrcola, terrenos que han sido transformados y ocupados para la produccin de cultivos cuyo objetivo es satisfacer las necesidades alimentarias, comerciales y agrcolas.

En caso de encontrar actividad agrcola y actividad pecuaria en un mismo predio, se califica segn la actividad que predomine. Si, ambas actividades tienen el mismo porcentaje de participacin en el predio, se debe calificar como agrcola.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Agroindustrial',2,'Agroindustrial','0','Se califica con destino agroindustrial, aquellos predios destinados a la actividad que implica cultivo (produccin) y transformacin (industrializacin y comercializacin) de productos agrcola, pecuario y forestal.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Agroforestal',3,'Agroforestal','0','Se califica con destino agroforestal, aquellos predios destinados al establecimiento y aprovechamiento combinado de especies forestales con actividades agrcolas o pecuarias con arreglos diferenciados. Incluye la actividad agrosilvcola, silvopastoril y agrosilvopastoril.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Comercial',4,'Comercial','0','Se califica con destino comercial, aquellos predios cuya finalidad es la de realizar la actividad econmica de ofrecer, transar o almacenar bienes y/o servicios a travs de un mercader o comerciante.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Cultural',5,'Cultural','0','Se califica con destino cultural, aquellos predios considerados como bienes culturales de la nacin, adems los espacios destinados al desarrollo de actividades artsticas.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Educativo',6,'Educativo','0','Se califica con destino educativo, aquellos predios donde se desarrollan actividades acadmicas, tanto de la educacin inicial, preescolar, bsica, media y superior. Incluye los jardines, escuelas, colegios, institutos tcnicos, fundaciones educativas, centros de investigacin y universidades.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Forestal',7,'Forestal','0','Se califica con destino forestal, aquellos predios con reas naturales o seminaturales, constituidas principalmente por elementos arbreos de especies nativas, exticas e introducidas.  Incluye las plantaciones forestales comerciales y los bosques naturales y seminaturales.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Habitacional',8,'Habitacional','0','Se califica con destino habitacional, aquellos predios de uso residencial cuya finalidad es la vivienda habitual de las personas. Incluye los parqueaderos, garajes y depsitos dentro de propiedad horizontal como tambin los predios rurales de vivienda campestre.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Industrial',9,'Institucional','0','Se califica con destino industrial, aquellos predios donde se desarrollan actividades de produccin, fabricacin, preparacin, recuperacin, reproduccin, ensamblaje, construccin, transformacin, tratamiento y manipulacin de materias primas para producir bienes o productos materiales y que no estn clasificados dentro de los predios mineros.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Infraestructura_Asociada_Produccion_Agropecuaria',10,'Infraestructura asociada a produccin agropecuaria','0','Se califica con destino infraestructura asociada a la produccin agropecuaria, aquellos predios sobre los cuales se encuentra la infraestructura requerida dentro de la actividad agropecuaria y que son de inters para el sector agropecuario, como: bancos de maquinaria, plantas de almacenamiento, centros de acopio, centros de transformacin agrcola, mataderos, etc.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Infraestructura_Hidraulica',11,'Infraestructura hidrulica','0','Se califica con destino infraestructura hidrulica, aquellos predios sobre los cuales se encuentra establecida infraestructura para controlar, almacenar y conducir un flujo continuo de agua. Incluye los embalses, represas, acueductos, centrales de tratamiento y distribucin, alcantarillados, estaciones depuradoras de aguas residenciales y distrito de adecuacin de tierras.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Infraestructura_Saneamiento_Basico',12,'Infraestructura saneamiento','0','Se califica con destino infraestructura de saneamiento bsico, aquellos predios sobre los cuales se encuentra establecida la infraestructura para el saneamiento bsico, con excepcin del alcantarillado. Incluye los centros de acopio de basura y material reciclable, rellenos sanitarios e incineradoras.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Infraestructura_Seguridad',13,'Infraestructura seguridad','0','Se califica con destino infraestructura de seguridad, aquellos predios sobre los cuales se encuentra establecida infraestructura destina a salvaguardar el orden pblico. Incluye las estaciones de polica, batallones, crceles, etc.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Infraestructura_Transporte',14,'Infraestructura transporte','0','Se califica con destino infraestructura de transporte, aquellos predios en los cuales se encuentra establecida infraestructura para el desarrollo de actividad de transporte, muelles para embarque, desembarque de carga y/o pasajeros, pistas de aterrizaje, torres de control, centros de almacenamiento y venta de combustible, etc. Se exceptan de estas, aquellas plataformas flotantes y aquellas que se encuentren fuera de la plataforma continental.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Institucional',15,'Institucional','0','Se califica con destino institucional, aquellos predios destinados a la administracin y prestacin de servicios del Estado tanto de orden nacional como territorial.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Mineria_Hidrocarburos',16,'Minera hidrocarburos','0','Se califica con destino minera e hidrocarburos, aquellos predios donde se hace aprovechamiento directo de los recursos minerales o transformacin primaria de los mismos.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Lote_Urbanizable_No_Urbanizado',17,'Lote urbanizable no urbanizado','0','Se califica con este destino, aquellos predios urbanos no construidos, ubicados en terrenos de grandes reas que no han sido desarrollados y sin restriccin legal para adelantar algn tipo de desarrollo urbanstico.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Lote_Urbanizado_No_Construido',18,'Lote urbanizado no construido','0','Se califica con este destino, aquellos predios urbanos no construidos, ubicados en zonas urbanizadas, es decir, con infraestructura de servicios pblicos e infraestructura vial.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Lote_No_Urbanizable',19,'Lote no urbanizable','0','Se califica con este destino, aquellos predios urbanos o rurales clasificados por el instrumento de planeacin como suelo de proteccin, tambin se incluyen los predios con afectacin, por ejemplo los utilizados como servidumbres para los servicios pblicos.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Pecuario',20,'Pecuario','0','Se califica con destino pecuario, aquellos predios destinados a la cra, beneficio y aprovechamiento de especies de animales no domsticos, para el consumo humano (productos crnicos y lcteos), uso artesanal (lana, cuero, plumas, etc.) y conservacin de fauna (zoocra).','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Recreacional',21,'Recreacional','0','Se califica con destino recreacional, aquellos predios que corresponden a equipamientos deportivos y recreativos, parques de propiedad privada o pblica, clubes, generando bienestar fsico y social.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Religioso',22,'Religioso','0','Se califica con destino religioso, aquellos predios cuya finalidad es el culto religioso pblico, incluye las parroquias, baslicas, catedrales, santuarios, capillas, colegiatas, monasterios, conventos y seminarios.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Salubridad',23,'Salubridad','0','Se califica con destino salubridad, aquellos predios destinados al cuidado de la salud de los ciudadanos, incluye los hospitales, centros de salud, clnicas, laboratorios y consultorios que prestan el servicio de salud tanto carcter pblico o privado','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.lc_destinacioneconomicatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Uso_Publico',24,'Uso pblico','0','Se califica con destino uso pblico, aquellos predios urbanos o rurales, que conforman el espacio pblico, como las zonas verdes, alamedas, plazas (no se incluyen las plazas de mercado), plazoletas parques, cuerpos de agua, reas de control y proteccin ambiental, tneles, vas, ciclorutas, glorietas, etc.','Levantamiento_Catastral_V2_11.LC_DestinacionEconomicaTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Edificios',0,'Edificios','0','Comprende la agrupacin de edificaciones de tipo habitacional, industrial, comercial e institucional que no estn consideradas dentro del plan de ordenamiento territorial como parte de la zona urbana ej. Caseros, zonas industriales, universidades.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Otras_Construcciones',1,'Otras construcciones','0','Comprende construcciones de otro tipo diferente a edificios por su tamao o actividad ej, represas, aeropuertos, centrales hidroelctricas, estadios, plazas de toros, bases militares.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Parques_Naturales',2,'Parques naturales','0','Son reas naturales definidas y delimitadas oficialmente poco transformadas por la explotacin u ocupacin humana que, en razn a la belleza de sus paisajes, la representatividad de sus ecosistemas o la singularidad de su flora, de su fauna o de sus formaciones geomorfolgicas, poseen unos valores ecolgicos, estticos, educativos y cientficos cuya conservacin merece una atencin preferente.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Cultivos_De_Caracter_Permanente',3,'Cultivos de carcter permanente','0','Aquellos cultivos tales como caf, palma africana, palma africana, palma de coco, caucho, ctricos, arboles maderables, aguacate, guayabo, mango, manzano, pera, durazno, uva, noli, fique, cacao y cualquier otro cultivo que exija un periodo superior a tres aos entre su siembre y su cosecha, o cuyo periodo de produccin se prolongue por mas de cinco aos.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Tierras_De_Labor_Irrigadas',4,'Tierras de labor irrigadas','0','Aquellas tierras que para su produccin cuentan con aplicacin de agua, que de suyo falta para el desarrollo del cultivo, mediante la utilizacin de un sistema de irrigacin.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Tierras_De_Labor_No_Irrigadas',5,'Tierras de labor no irrigadas','0','Aquellas tierras que carecen de un sistema de irrigacin y que para su produccin dependen exclusivamente del agua lluvia ciada sobre ellas.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Tierras_Con_Maleza',6,'Tierras con maleza','0','Aquellas tierras en donde predominen las plantaciones espontaneas de arbustos que obstaculizan la utilizacin econmica del suelo.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Tierras_Improductivas',7,'Tierras improductivas','0','Aquellas reas que por sus condiciones topogrficas, climatolgicas y que en general por las caractersticas fsicas o qumicas de sus suelos no puedan ser explotadas.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Pastos_Naturales',8,'Pastos naturales','0','Conjuntos de herbceos forrajeros producidos espontneamente por el suelo.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Pastos_Artificales',9,'Pastos artificiales','0','Conjunto de cultivos herbceos forrajeros no producidos espontneamente.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Pastos_Naturales_Mejorados',10,'Pastos naturales mejorados','0','Pastos naturales sometidos a prcticas tcnicas de uso y manejo','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Bosques',11,'Bosques','0','Conjunto de plantaciones naturales o de cultivos de arboles de igual o distinta naturaleza que estn en explotacin o pueden ser explotados.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Selvas_Virgenes',12,'Selvas vrgenes','0','Terrenos extensos, incultos y abundantemente poblados con vegetacin arbrea y nativa.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Cuerpos_De_Agua',13,'Cuerpos de agua','0','Comprende aquellas rea cubiertas de agua con carcter permanente que puede ser de origen natural o artificial.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Condiciones_Especiales',14,'Condiciones especiales','0','Comprende aquellas edificaciones que por sus caractersticas especiales por actividad son diferentes a las anteriores ej. Condominios, parcelaciones, parques recreacionales.','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
INSERT INTO ladm_col_211.av_usosueloruraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Mixto',15,'Mixto','0','Al clasificar usos mixtos, se agrupan mximo 2 tipos de uso que son de difcil separacin por la escala de mapeo, considrelos como, una unidad miscelnea pero destaque el uso dominante designndolo con un nmero fraccionario en que el numerador sea el elemento dominante','Avaluos_V2_11.AV_UsoSueloRuralTipo',NULL);
