INSERT INTO ladm_col_211.ant_motivoconsideracionderechotipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Ha_Arrendado',6,'Porque lo ha dado en arriendo','0',NULL,'ANT_V2_11.ANT_MotivoConsideracionDerechoTipo',NULL);
