INSERT INTO ladm_col_211.col_fuenteadministrativatipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Documento_Publico',0,'Documento pblico','0','Documento pblico es el otorgado por el funcionario pblico en ejercicio de sus funciones o con su intervencin. As mismo, es pblico el documento otorgado por un particular en ejercicio de funciones pblicas o con su intervencin. Cuando consiste en un escrito autorizado o suscrito por el respectivo funcionario, es instrumento pblico; cuando es autorizado por un notario o quien haga sus veces y ha sido incorporado en el respectivo protocolo, se denomina escritura pblica.','LADM_COL_V1_7.LADM_Nucleo.COL_FuenteAdministrativaTipo',NULL);
