INSERT INTO ladm_col_211.lc_procedimientocatastralregistraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Actualizacion_Linderos',0,'Actualizacin linderos con efectos registrales','0','El gestor catastral competente, de oficio o a solicitud de parte del titular del derecho de dominio, o de las entidades pblicas que con ocasin de sus funciones legales administran inmuebles propios o ajenos, podrn efectuar la actualizacin mediante la descripcin tcnica de linderos de bienes inmuebles, cuando sean verificables mediante mtodos directos y/o indirectos sin variacin, o cuando la variacin o diferencia se encuentre dentro de los mrgenes de tolerancia establecidos por la mxima autoridad catastral. La descripcin de los linderos llevar a la certeza del rea. Articulo 2.2.2.2.17. Decreto 148 de 2020.','Levantamiento_Catastral_V2_11.LC_ProcedimientoCatastralRegistralTipo',NULL);
INSERT INTO ladm_col_211.lc_procedimientocatastralregistraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Rectificacion_Area',1,'Rectificacin de rea por imprecisa determinacin con efectos registrales','0','La rectificacin de rea en el sistema catastral y/o registral proceder ante el gestor catastral, de oficio o a solicitud de parte del titular  del derecho de dominio, o de las entidades pblicas que con ocasin de sus funciones legales administran inmuebles propios o ajenos, cuando los linderos estn debida y tcnicamente descritos, sean verificables mediante mtodos directos y/o indirectos sin variacin, pero que a lo largo de la tradicin del bien inmueble el rea de ste no haya sido determinada adecuadamente, o cuando la variacin o diferencia se encuentre dentro de los mrgenes de tolerancia establecidos por la mxima autoridad catastral. Artculo 2.2.2.2.17. Decreto 148 de 2020.','Levantamiento_Catastral_V2_11.LC_ProcedimientoCatastralRegistralTipo',NULL);
INSERT INTO ladm_col_211.lc_procedimientocatastralregistraltipo (seq,iliCode,itfCode,dispName,inactive,description,thisClass,baseClass) VALUES (NULL,'Rectificacion_Linderos',2,'Rectificacin de linderos por acuerdo entre las partes con efectos registrales','0','La rectificacin de linderos en el sistema catastral y registral proceder de oficio o a solicitud de parte, ante el gestor catastral, siempre y cuando se haya suscrito acta de colindancia con pleno acuerdo entre los propietarios que compartan uno o varios linderos, pero se adviertan diferencias de linderos y reas, entre la verificacin mediante mtodos directos y/o indirectos y la informacin del folio de matricula inmobiliaria. La rectificacin de todos los linderos puede llevar a la certeza del rea del inmueble. Artculo 2.2.2.2.17. Decreto 148 de 2020.','Levantamiento_Catastral_V2_11.LC_ProcedimientoCatastralRegistralTipo',NULL);
