INSERT INTO ladm_col_211.T_ILI2DB_MODEL (filename,iliversion,modelName,content,importDate) VALUES ('ISO19107_PLANAS_V2.ili','2.3','ISO19107_PLANAS_V2','INTERLIS 2.3;

