 * 15.06.2017/fm: cambio de version a 2.1.2, se quita el atributo geometra de la clase predio. se reemplaza el atributo OID por los atributos atributos namespace y localId. Se aaden atributos folio matriz y segregados al predio. se elimina el dominio transaccion_registral_tipo
