       */
      !!@ ili2db.dispName = "Tipo de planta"
      Tipo_Planta : Levantamiento_Catastral_V2_11.LC_ConstruccionPlantaTipo;
      /** Indica numricamente la ubicacin del predio de acuerdo al tipo de planta.
       */
      !!@ ili2db.dispName = "Planta ubicacin"
      Planta_Ubicacion : 0 .. 500;
      /** Nmero total de  habitaciones en la unidad de construccin.
       */
      !!@ ili2db.dispName = "Total de habitaciones"
      Total_Habitaciones : 0 .. 999999;
      /** Nmero total de baos en la unidad de construccin.
       */
      !!@ ili2db.dispName = "Total de baos"
      Total_Banios : 0 .. 999999;
      /** Nmero total de locales en la unidad de construccin.
       */
      !!@ ili2db.dispName = "Total de locales"
      Total_Locales : 0 .. 999999;
      /** Nmero total de pisos en la unidad de construccin.
       */
      !!@ ili2db.dispName = "Total de pisos"
      Total_Pisos : 0 .. 150;
      /** Actividad que se desarrolla en una unidad de construccin.
       */
      !!@ ili2db.dispName = "Uso"
      Uso : Levantamiento_Catastral_V2_11.LC_UsoUConsTipo;
      /** Ao de construccin de la unidad de construccin.
       */
      !!@ ili2db.dispName = "Ao de construccin"
      Anio_Construccion : 1512 .. 2500;
      /** Avalo catastral de la unidad de construccin.
       */
      !!@ ili2db.dispName = "Avalo de la unidad de construccin"
      Avaluo_Unidad_Construccion : LADM_COL_V1_7.LADM_Nucleo.Peso;
      /** rea total construida en la unidad de construccin.
       */
      !!@ ili2db.dispName = "rea construida"
      Area_Construida : MANDATORY 0.0 .. 99999999999999.9 [LADM_COL_V1_7.m2];
      /** rea total privada de la unidad de construccin para los predios en rgimen de propiedad horizontal.
       */
      !!@ ili2db.dispName = "rea privada construida"
      Area_Privada_Construida : 0.0 .. 99999999999999.9 [LADM_COL_V1_7.m2];
      /** Altura total de la unidad de construccin.
       */
      !!@ ili2db.dispName = "Altura"
      Altura : 1 .. 1000 [INTERLIS.m];
      /** Observaciones generales respecto de la unidad de construccin.
       */
      !!@ ili2db.dispName = "Observaciones"
      Observaciones : TEXT;
    END LC_UnidadConstruccion;

    /** Relacin entre la clase Unidad_Construccion del modelo de Avalos y Calificacion_Unidad_Construccion de modelo de Avalos
     */
    ASSOCIATION lc_calificacion_unidadconstruccion =
      lc_unidad_construccion (EXTERNAL) -- {1} LC_UnidadConstruccion;
      lc_calificacion_unidad_construccion -- {0..1} LC_CalificacionUnidadConstruccion;
    END lc_calificacion_unidadconstruccion;

    ASSOCIATION lc_construccion_unidadconstruccion =
      lc_unidadconstruccion -- {0..*} LC_UnidadConstruccion;
      lc_construccion -<> {1} LC_Construccion;
    END lc_construccion_unidadconstruccion;

  END Levantamiento_Catastral;

END Levantamiento_Catastral_V2_11.
