  /** Este Topic agrupa a las clases especficas del avalo, as como sus atributos.
   */
  TOPIC Avaluos =
    OID AS INTERLIS.UUIDOID;
    DEPENDS ON Levantamiento_Catastral_V2_11.Levantamiento_Catastral;

    /** Clase los valores por M2 de construccin segn el uso y puntaje de calificacin de construccin.
     */
    !!@ ili2db.dispName = "(Avalos) Tabla Calificacin de la Construccin"
    CLASS AV_TablaCalificacionConstruccion =
      /** Valor por metros cuadrado de construccin clasificando por uso y puntaje de las unidades de construccin.
       */
      !!@ ili2db.dispName = "Valor M2 de construccin"
      Valor_M2_Construccion : LADM_COL_V1_7.LADM_Nucleo.Peso;
      /** Es la actividad que se desarrolla en una unidad de construccin.
       */
      !!@ ili2db.dispName = "Uso"
      Uso : Avaluos_V2_11.AV_UsoUConsTipo;
      /** Puntaje de las edificaciones de acuerdo a sus caractersticas constructivas.
       */
      !!@ ili2db.dispName = "Puntuacin"
      Puntuacion : TEXT*20;
    END AV_TablaCalificacionConstruccion;

    /** Clase que relaciona las tipologias de las construcciones con su respectivo valor por M2 de construccin.
     */
    !!@ ili2db.dispName = "(Avalos) Tipologa de la construccin"
    CLASS AV_TipologiaConstruccion =
      /** Se refiere a la zonificacin del municipio de acuerdo con las clasificaciones de los inmuebles segn su
       * actividad residencial, comercial e industrial.
       */
      !!@ ili2db.dispName = "Tipo de topologa"
      Tipo_Tipologia : Avaluos_V2_11.AV_TipologiaTipo;
      /** Valor unitario en pesos del tipo de tipologa constructiva.
       */
      !!@ ili2db.dispName = "Valor unitario"
      Valor_Unitario : LADM_COL_V1_7.LADM_Nucleo.Peso;
      UNIQUE Tipo_Tipologia; 
    END AV_TipologiaConstruccion;

    /** Clase que contiene las variables que componen las Zonas Homogeneas Fisicas rurales. Las ZHF Son espacios geogrficos con caractersticas similares en cuanto a vas, topografa, servicios pblicos, uso actual del suelo, norma de uso del suelo, tipificacin de las construcciones y/o edificaciones, reas homogneas de tierra, disponibilidad de aguas superficiales permanentes u otras variables que permitan diferenciar estas reas de las adyacentes.
     */
    !!@ ili2db.dispName = "(Avalos) Zona homognea fsica rural"
    CLASS AV_ZonaHomogeneaFisicaRural =
      /** Cdigo nico del registro de la instancia de ZonaHomegeneaFisca.
       */
      !!@ ili2db.dispName = "Cdigo"
      Codigo : MANDATORY TEXT*7;
      /** Identificador de la zona homognea fsica rural.
       */
      !!@ ili2db.dispName = "Cdigo zona fsica"
      Codigo_Zona_Fisica : MANDATORY TEXT*20;
      /** Espacios de la superficie terrestre que presentan caractersticas o cualidades similares en cuanto a las condiciones de clima, relieve, material litolgico superficial o depsitos superficiales y de las caractersticas internas de los suelos, condiciones que expresan la capacidad productiva de las tierras; ello se indica mediante un valor numrico denominado Valor Potencial (VP).
       */
      !!@ ili2db.dispName = "rea homognea tierra"
      Area_Homogenea_Tierra : 0.00 .. 99999999999999990000000.00;
      /** En el estudio de esta variable se analiza la existencia de fuentes de aguas superficiales permanentes y su clasificacin, con el fin de zonificar de acuerdo con la posibilidad de aprovechamiento para el uso actual que se da al suelo.
       */
      !!@ ili2db.dispName = "Disponibilidad agua"
      Disponibilidad_Agua : Avaluos_V2_11.AV_DisponibilidadAguaTipo;
      /** Se refiere a la existencia y calidad de las vas, analizada a nivel de zona. A esta condicin se asocia la existencia de otras obras de ingeniera, la instalacin de redes de servicios pblicos, etc.
       */
      !!@ ili2db.dispName = "Influencia vial"
      Influencia_Vial : Avaluos_V2_11.AV_InfluenciaVialRuralTipo;
      /** Actividad que se desarrolla en un determinado espacio geogrfico en el momento de la elaboracin del estudio de zonas homogneas fsicas.
       */
      !!@ ili2db.dispName = "Uso actual del suelo"
      Uso_Actual_Suelo : Avaluos_V2_11.AV_UsoSueloRuralTipo;
      /** Indicacin legal sobre la actividad que se puede desarrollar en un determinado espacio geogrfico con lo planificado y reglamentado por la respectiva autoridad de la unidad orgnica catastral.
       */
      !!@ ili2db.dispName = "Norma uso del suelo"
      Norma_Uso_Suelo : TEXT*250;
      /** Vigencia del estudio de zonas homogeneas fisicas rurales.
       */
      !!@ ili2db.dispName = "Vigencia"
      Vigencia : INTERLIS.XMLDate;
      /** Definicin de la geometra espacial georreferenciada de la zona homognea fsica, delimitada mediante un polgono que contiene sus linderos y la superficie ocupada.
       */
      !!@ ili2db.dispName = "Geometra"
      Geometria : MANDATORY ISO19107_PLANAS_V2.GM_MultiSurface3D;
    END AV_ZonaHomogeneaFisicaRural;

    /** Clase que contiene las variables que componen las Zonas Homogeneas Fisicas urbanas. Las ZHF Son espacios geogrficos con caractersticas similares en cuanto a vas, topografa, servicios pblicos, uso actual del suelo, norma de uso del suelo, tipificacin de las construcciones y/o edificaciones, reas homogneas de tierra, disponibilidad de aguas superficiales permanentes u otras variables que permitan diferenciar estas reas de las adyacentes.
     */
    !!@ ili2db.dispName = "(Avalos) Zona homognea fisca urbana"
    CLASS AV_ZonaHomogeneaFisicaUrbana =
      /** Cdigo nico del registro de la instancia de ZonaHomegeneaFisca.
       */
      !!@ ili2db.dispName = "Cdigo"
      Codigo : MANDATORY TEXT*7;
      /** Identificador de la zona homognea fsica urbana.
       */
      !!@ ili2db.dispName = "Cdigo zona fsica"
      Codigo_Zona_Fisica : MANDATORY TEXT*20;
      /** Caractersticas naturales relacionadas con el relieve que permitan o dificulten el desarrollo de las construcciones, dentro de esta variable deben considerarse factores tales como zonas anegadizas o inundables, las discontinuidades fsicas tales como taludes, caos y ros, altura por encima de la cota de servicios, reas potenciales de derrumbe, por inclinacin o presencia de drenajes superficiales.
       */
      !!@ ili2db.dispName = "Topografa"
      Topografia : Avaluos_V2_11.AV_TopografiaZonaTipo;
      /** Se refiere a la existencia y calidad de las vas, analizada a nivel de zona. A esta condicin se asocia la existencia de otras obras de ingeniera, la instalacin de redes de servicios pblicos, etc.
       */
      !!@ ili2db.dispName = "Influencia vial"
      Influencia_Vial : Avaluos_V2_11.AV_InfluenciaVialUrbanaTipo;
      /** Se prestan con la finalidad especfica de satisfacer las necesidades esenciales de las personas. Para efectos de la presente metodologa se consideran servicios pblicos bsicos: Acueducto, Alcantarillado y Energa Elctrica.
       */
      !!@ ili2db.dispName = "Servicio pblico"
      Servicio_Publico : Avaluos_V2_11.AV_ServiciosPublicosTipo;
      /** Actividad que se desarrolla en un determinado espacio geogrfico en el momento de la elaboracin del estudio de zonas homogneas fsicas.
       */
      !!@ ili2db.dispName = "Uso actual del suelo"
      Uso_Actual_Suelo : Avaluos_V2_11.AV_UsoSueloUrbanoTipo;
      /** Indicacin legal sobre la actividad que se puede desarrollar en un determinado espacio geogrfico con lo planificado y reglamentado por la respectiva autoridad de la unidad orgnica catastral.
       */
      !!@ ili2db.dispName = "Norma uso del suelo"
      Norma_Uso_Suelo : TEXT*250;
      /** Clasificacin de las construcciones de acuerdo a ciertas caractersticas observables y cuantificables que reflejan las condiciones socioeconmicas (ingresos y cultura) de los habitantes de las viviendas.
       */
      !!@ ili2db.dispName = "Tipificacin de la construccin"
      Tipificacion_Construccion : Avaluos_V2_11.AV_TipificacionConstruccionTipo;
      /** Vigencia del estudio de zonas homogeneas fisicas urbanas.
       */
      !!@ ili2db.dispName = "Vigencia"
      Vigencia : INTERLIS.XMLDate;
      /** Definicin de la geometra espacial georreferenciada de la zona homognea fsica, delimitada mediante un polgono que contiene sus linderos y la superficie ocupada.
       */
      !!@ ili2db.dispName = "Geometra"
      Geometria : MANDATORY ISO19107_PLANAS_V2.GM_MultiSurface3D;
    END AV_ZonaHomogeneaFisicaUrbana;

    /** Clase que contiene las variables que componen las Zonas Homogeneas Geoconmicas rurales. Las ZHG son los espacios geogrficos determinados a partir de Zonas Homogneas Fsicas con valores unitarios similares en cuanto a su precio, segn las condiciones del mercado inmobiliario.
     */
    !!@ ili2db.dispName = "(Avalos) Zona homognea geoeconmica urbana"
    CLASS AV_ZonaHomogeneaGeoeconomicaUrbana =
      /** Cdigo nico del registro de la instancia de la zona geoeconmica.
       */
      !!@ ili2db.dispName = "Cdigo"
      Codigo : MANDATORY TEXT*7;
      /** Identificador de la zona homognea geoeconmica urbana.
       */
      !!@ ili2db.dispName = "Cdigo zona geoeconmica"
      Codigo_Zona_Geoeconomica : MANDATORY TEXT*20;
      /** Valor econmico de la zona homognea que representa la instancia de la clase.
       */
      !!@ ili2db.dispName = "Valor del metro cuadrado"
      Valor_Metro : MANDATORY LADM_COL_V1_7.LADM_Nucleo.Peso;
      /** Cdigos de las zonas homogeneas fisicas urbanas que componen la zona homognea geoeconmica urbana.
       */
      !!@ ili2db.dispName = "Subzona fsica"
      Subzona_Fisica : TEXT;
      /** Vigencia del estudio de zonas homogneas geoeconmicas urbanas.
       */
      !!@ ili2db.dispName = "Vigencia"
      Vigencia : INTERLIS.XMLDate;
      /** Definicin de la geometra espacial georreferenciada de la zona homognea geoeconmica, delimitada mediante un polgono que contiene sus linderos y la superficie ocupada.
       */
      !!@ ili2db.dispName = "Geometra"
      Geometria : MANDATORY ISO19107_PLANAS_V2.GM_MultiSurface3D;
    END AV_ZonaHomogeneaGeoeconomicaUrbana;

    /** Esta clase permite gestionar las zonas con caractersticas econmicas y de localizacin geogrfica similares, definidas para caracterizar el avalo.
     */
    !!@ ili2db.dispName = "(Avalos) Zona homognea geoeconmica rural"
    CLASS AV_ZonaHomogeneaGeoeconomicaRural =
      /** Cdigo nico del registro de la instancia de la zona geoeconmica.
       */
      !!@ ili2db.dispName = "Cdigo"
      Codigo : MANDATORY TEXT*7;
      /** Identificador de la zona homognea geoeconmica rural.
       */
      !!@ ili2db.dispName = "Cdigo zona geoeconmica"
      Codigo_Zona_Geoeconomica : MANDATORY TEXT*20;
      /** Valor econmico de la zona homognea que representa la instancia de la clase.
       */
      !!@ ili2db.dispName = "Valor por hectrea"
      Valor_Hectarea : MANDATORY LADM_COL_V1_7.LADM_Nucleo.Peso;
      /** Cdigos de las zonas homogeneas fisicas rurales que componen la zona homognea geoeconmica rural.
       */
      !!@ ili2db.dispName = "Subzona fsica"
      Subzona_Fisica : TEXT;
      /** Vigencia del estudio de zonas homogneas geoeconmicas rurales.
       */
      !!@ ili2db.dispName = "Vigencia"
      Vigencia : INTERLIS.XMLDate;
      /** Definicin de la geometra espacial georreferenciada de la zona homognea geoeconmica, delimitada mediante un polgono que contiene sus linderos y la superficie ocupada.
       */
      !!@ ili2db.dispName = "Geometra"
      Geometria : MANDATORY ISO19107_PLANAS_V2.GM_MultiSurface3D;
    END AV_ZonaHomogeneaGeoeconomicaRural;

  END Avaluos;

END Avaluos_V2_11.
